import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Fab from '@material-ui/core/Fab';
import AddIcon from '@material-ui/icons/Add'
import whatsAppIcon from "../../Assets/CONTACT/whatsapp.png"
import Typography from '@material-ui/core/Typography';


const useStyles = makeStyles(theme => ({
  root:{

      background: "white",
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

export default function CenteredGrid() {
  const classes = useStyles();

  return (
    <div  style={{margin: "10% 7% 0% 7%"}}>
      <Grid container spacing={3}>
        <Grid item xs={3}>
            <Fab  aria-label="add" classes={classes}>
            <img src={whatsAppIcon} style={{maxWidth: "40px"}}></img>
            </Fab>
        </Grid>
        <Grid item xs={9}>
             <Typography variant="body2" color="textSecondary" component="p" className="subTitle" style={{fontFamily: 'montserrat', letterSpacing: '-0.02em', paddingTop: "7%"}}>
                  albert.collell@gmail.com
                </Typography>
        </Grid>

      </Grid>
    </div>
  );
}
